', '{"value": [{"id": "Ouvid-Relatório-OuvidoriaAnual-2022", "codigo": "OuvidoriaAnual", "assunto": "O relatório destaca as manifestações recebidas, a atuação da unidade no aprimoramento de serviços do BC e no monitoramento das medidas para cumprimento da Lei de Acesso à Informação (LAI)  Lei nº 12.527, de 18 de novembro de 2011  na Autarquia, incluindo a Política de Dados Abertos do Poder Executivo Federal (Decreto nº 8.777, de 11 de maio de 2016).", "periodo": "2022", "dataHora": "2023-01-01", "tipo_doc": "Relatório", "tituloRel": "Relatório da Ouvidoria 2022", "urlDocHtm": "", "urlDocPDF": "", "versaoRel": "1"}, {"id": "Ouvid-Relatório-OuvidoriaAnual-2021", "codigo": "OuvidoriaAnual", "assunto": "O relatório destaca as manifestações recebidas, a atuação da unidade no aprimoramento de serviços do BC e no monitoramento das medidas para cumprimento da Lei de Acesso à Informação (LAI)  Lei nº 12.527, de 18 de novembro de 2011  na Autarquia, incluindo a Política de Dados Abertos do Poder Executivo Federal (Decreto nº 8.777, de 11 de maio de 2016).", "periodo": "2021", "dataHora": "2022-01-01", "tipo_doc": "Relatório", "tituloRel": "Relatório da Ouvidoria 2021", "urlDocHtm": "https://www.bcb.gov.br/conteudo/dadosabertos/BCBDeinf/relatorios/Relatorio_ouvidoria_2021_FINAL_DC.htm", "urlDocPDF": "https://www.bcb.gov.br/conteudo/dadosabertos/BCBDeinf/relatorios/Ouvid_Relatório_OuvidoriaAnual_2021.pdf", "versaoRel": "1"}, {"id": "Ouvid-Relatório-PDA-2021", "codigo": "PDA", "assunto": "A nova edição do PDA/BC (2021-2023), balizada pelas orientações estratégicas do Banco Central e alinhada à Resolução BC 37/ 2020, que instituiu a política de transparência do BC, consolida  o valor institucional da transparência prevendo a governança necessária para o alcance e a permanente sustentação dos resultados pretendidos, estabelece os responsáveis pela atualização das bases de dados, indica os canais de comunicação pelos quais será promovida a interação com a sociedade e determina os padrões para a adequada catalogação e publicação dos dados a serem disponibilizados. Nessa versão, destaca-se a realização de consultas públicas como mecanismo adicional para priorização das bases de dados a serem disponibilizadas, além da atenção especial à divulgação de bases textuais em formato aberto.", "periodo": "2021", "dataHora": "2021-06-15", "tipo_doc": "Relatório", "tituloRel": "Plano de Dados Abertos 2021-2023", "urlDocHtm": "https://www.bcb.gov.br/conteudo/dadosabertos/BCBDeinf/relatorios/pda.html", "urlDocPDF": "https://www.bcb.gov.br/conteudo/dadosabertos/BCBDeinf/relatorios/PDA_BCB_mai2021-abr2023 - FINAL.pdf", "versaoRel": "1"}, {"id": "Ouvid-Relatório-OuvidoriaAnual-2020", "codigo": "OuvidoriaAnual", "assunto": "O relatório destaca as manifestações recebidas, a atuação da unidade no aprimoramento de serviços do BC e no monitoramento das medidas para cumprimento da Lei de Acesso à Informação (LAI)  Lei nº 12.527, de 18 de novembro de 2011  na Autarquia, incluindo a Política de Dados Abertos do Poder Executivo Federal (Decreto nº 8.777, de 11 de maio de 2016).", "periodo": "2020", "dataHora": "2021-01-01", "tipo_doc": "Relatório", "tituloRel": "Relatório da Ouvidoria 2020", "urlDocHtm": "https://www.bcb.gov.br/conteudo/dadosabertos/BCBDeinf/relatorios/Relatorio_ouvidoria_2020_PUBLICADO.htm", "urlDocPDF": "https://www.bcb.gov.br/conteudo/dadosabertos/BCBDeinf/relatorios/Relatorio_ouvidoria_2020_PUBLICADO.pdf", "versaoRel": "1"}], "@odata.context": "https://was-p.bcnet.bcb.gov.br/olinda/servico/DadosAbertosTextuais/versao/v1/odata$metadata#ouvidoria"}');


