INSERT INTO api_endpoints (id, api_id, name, url, description, example, api_responses_id) VALUES (121, 6, 'Estatísticas do SPI - Sistema de Pagamentos Instantâneos - PixDisponibilidadeSPI', 'https://olinda.bcb.gov.br/olinda/servico/SPI/versao/v1/odata/PixDisponibilidadeSPI', 'Informações sobre a disponibilidade do SPI frente ao mínimo normativo. Segue a fórmula id = (hf / hp) x 100, onde id = índice de disponibilidade; hf = número de horas de efetivo funcionamento do SPI, ao longo dos últimos três meses; hp = número de horas em que o SPI deveria estar aberto para uso pel', 'https://olinda.bcb.gov.br/olinda/servico/SPI/versao/v1/odata/PixDisponibilidadeSPI', 117);
INSERT INTO api_endpoints (id, api_id, name, url, description, example, api_responses_id) VALUES (122, 6, 'Estatísticas do STR - Sistema de Transferência de Reservas - GiroEvolucaoDiaria', 'https://olinda.bcb.gov.br/olinda/servico/STR/versao/v1/odata/GiroEvolucaoDiaria', 'Movimentações financeiras transitadas no STR na data considerando todas as ordens que resultam em movimentação financeira, exceto Recolhimentos Compulsórios e Meio Circulante. Este valor é representado em R$ milhões.', 'https://olinda.bcb.gov.br/olinda/servico/STR/versao/v1/odata/GiroEvolucaoDiaria', 118);
INSERT INTO api_endpoints (id, api_id, name, url, description, example, api_responses_id) VALUES (123, 6, 'Estatísticas do STR - Sistema de Transferência de Reservas - GiroDetalhamento', 'https://olinda.bcb.gov.br/olinda/servico/STR/versao/v1/odata/GiroDetalhamento', 'Detalhamento das transferências financeiras relacionadas com outros sistemas de liquidação do SPB (Sistema de Pagamentos Brasileiro), outras transferências de instituição financeira, e transferências do governo. Média percentual nos últimos 21 dias úteis e no último dia útil.', 'https://olinda.bcb.gov.br/olinda/servico/STR/versao/v1/odata/GiroDetalhamento', 119);
INSERT INTO api_endpoints (id, api_id, name, url, description, example, api_responses_id) VALUES (124, 6, 'Estatísticas do STR - Sistema de Transferência de Reservas - PagamentosIntradia', 'https://olinda.bcb.gov.br/olinda/servico/STR/versao/v1/odata/PagamentosIntradia', 'Movimentações financeiras transitadas no STR, excluídas as mensagens dos grupos RCO e CIR. Média percentual, discriminadas por intervalo de trinta minutos, nos últimos 21 dias úteis', 'https://olinda.bcb.gov.br/olinda/servico/STR/versao/v1/odata/PagamentosIntradia', 120);
