INSERT INTO api_endpoints (id, api_id, name, url, description, example, api_responses_id) VALUES (126, 6, 'Estatísticas do STR - Sistema de Transferência de Reservas - TEDHistograma21Dias', 'https://olinda.bcb.gov.br/olinda/servico/STR/versao/v1/odata/TEDHistograma21Dias', 'Quantidade de movimentações financeiras referentes a TEDs que envolvem clientes transitadas no STR. Média móvel de 21 dias úteis por faixa de valor, nos últimos dois anos. As faixas utilizadas são: Faixa 1 - até R$ 999,99; Faixa 2 - de R$ 1.000,00 até R$ 2.999,99; Faixa 3 - de R$ 3.000,00 até R$ 9.9', 'https://olinda.bcb.gov.br/olinda/servico/STR/versao/v1/odata/TEDHistograma21Dias', 122);
