INSERT INTO api_responses (id, description, metadata, data_dictionary, response_example) VALUES (201, '38.1 Relatórios de inflação', null, 'https://olinda.bcb.gov.br/olinda/servico/Instituicoes_em_funcionamento/versao/v1/documentacao', '{"conteudo": [{"url": "https://www.bcb.gov.br/content/ri/relatorioinflacao/202309/ri202309p.pdf", "issn": "ISSN 1517-6576", "edicao": "3", "volume": "25", "descricao": "O relatório de inflação apresenta as diretrizes das políticas adotadas pelo Copom, considerações acerca da evolução recente do cenário econômico e projeções para a inflação. As projeções são apresentadas em cenários com condicionantes para algumas variáveis econômicas. O Copom utiliza um conjunto amplo de modelos e cenários para orientar suas decisões de política monetária. Ao expor alguns desses cenários, o Copom procura dar maior transparência às decisões de política monetária, contribuindo para sua eficácia no controle da inflação, que é seu objetivo precípuo.", "linkPaginaBC": "https://www.bcb.gov.br/publicacoes/ri/202309", "identificador": "202309", "dataReferencia": "2023-09-28"}, {"url": "https://www.bcb.gov.br/content/ri/relatorioinflacao/202306/ri202306p.pdf", "issn": "ISSN 1517-6576", "edicao": "2", "volume": "25", "descricao": "O relatório de inflação apresenta as diretrizes das políticas adotadas pelo Copom, considerações acerca da evolução recente do cenário econômico e projeções para a inflação. As projeções são apresentadas em cenários com condicionantes para algumas variáveis econômicas. O Copom utiliza um conjunto amplo de modelos e cenários para orientar suas decisões de política monetária. Ao expor alguns desses cenários, o Copom procura dar maior transparência às decisões de política monetária, contribuindo para sua eficácia no controle da inflação, que é seu objetivo precípuo.", "linkPaginaBC": "https://www.bcb.gov.br/publicacoes/ri/202306", "identificador": "202306", "dataReferencia": "2023-06-29"}, {"url": "https://www.bcb.gov.br/content/ri/relatorioinflacao/202212/ri202212p.pdf", "issn": "ISSN 1517-6576", "edicao": "4", "volume": "24", "descricao": "O relatório de inflação apresenta as diretrizes das políticas adotadas pelo Copom, considerações acerca da evolução recente do cenário econômico e projeções para a inflação. As projeções são apresentadas em cenários com condicionantes para algumas variáveis econômicas. O Copom utiliza um conjunto amplo de modelos e cenários para orientar suas decisões de política monetária. Ao expor alguns desses cenários, o Copom procura dar maior transparência às decisões de política monetária, contribuindo para sua eficácia no controle da inflação, que é seu objetivo precípuo.", "linkPaginaBC": "https://www.bcb.gov.br/publicacoes/ri/202212", "identificador": "202212", "dataReferencia": "2022-12-15"}, {"url": "https://www.bcb.gov.br/content/ri/relatorioinflacao/202303/ri202303p.pdf", "issn": "ISSN 1517-6576", "edicao": "1", "volume": "25", "descricao": "O relatório de inflação apresenta as diretrizes das políticas adotadas pelo Copom, considerações acerca da evolução recente do cenário econômico e projeções para a inflação. As projeções são apresentadas em cenários com condicionantes para algumas variáveis econômicas. O Copom utiliza um conjunto amplo de modelos e cenários para orientar suas decisões de política monetária. Ao expor alguns desses cenários, o Copom procura dar maior transparência às decisões de política monetária, contribuindo para sua eficácia no controle da inflação, que é seu objetivo precípuo.", "linkPaginaBC": "https://www.bcb.gov.br/publicacoes/ri/202303", "identificador": "202303", "dataReferencia": "2023-03-30"}, {"url": "https://www.bcb.gov.br/content/ri/relatorioinflacao/202209/ri202209p.pdf", "issn": "ISSN 1517-6576", "edicao": "3", "volume": "24", "descricao": "O relatório de inflação apresenta as diretrizes das políticas adotadas pelo Copom, considerações acerca da evolução recente do cenário econômico e projeções para a inflação. As projeções são